import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Bem-vindo ao Restaurante</h1>
      <Link to="/cadastro">
        <button>Cadastrar Prato</button>
      </Link>
      <Link to="/listar">
        <button>Listar Pratos</button>
      </Link>
    </div>
  );
}

export default Home;
